import React from 'react'
import { useLocation } from 'react-router-dom';
import { UserPosts } from './UserPosts';
import Box from '@mui/material/Box';

const UserProfile = () => {

    const location = useLocation();

  return (
    <div className="sig">

<h3 className='header-title'>User Details</h3> 
    <Box
      height={200}
      width={600}
      my={2}
      display="flex"
      alignItems="center"
      justifyContent= 'center'
      gap={4}
      p={2}
      sx={{ border: '2px solid grey' }}
    >
      <ul>
      <li>Name: {location.state.userData.name}</li>
      <li>Email: {location.state.userData.email}</li>
      <li>Phone: {location.state.userData.phone}</li>
      <li>WebSite: {location.state.userData.website}</li>
      </ul>  

      </Box>     
      <UserPosts/>
    </div>
  );
}

export default UserProfile
